[exclude_object]
[input_shaper]
[include mainsail.cfg]
[include motors_sync.cfg]
[include nest.cfg]

###################################################################
#    Tool Changer Configs
###################################################################
[include Toolchanger/homing.cfg]
[include Toolchanger/macros.cfg]
[include Toolchanger/extra_macros.cfg]
[include Toolchanger/toolchanger.cfg]

###################################################################
#    Tools Configs
###################################################################
[include Toolheads/T0.cfg]
[include Toolheads/T1.cfg]
[include Toolheads/T2.cfg]
[include Toolheads/T3.cfg]
[include Toolheads/T4.cfg]
[include Toolheads/T5.cfg]

###################################################################
#    Tool Changer LED
###################################################################
[include LED/tc_led_status_core.cfg]
[include LED/tc_led_status_settings.cfg]
[include LED/tc_led_template_loading.cfg]
[include LED/ToolheadLeds/T0-tool-leds.cfg]
[include LED/ToolheadLeds/T1-tool-leds.cfg]
[include LED/ToolheadLeds/T2-tool-leds.cfg]
[include LED/ToolheadLeds/T3-tool-leds.cfg]
[include LED/ToolheadLeds/T4-tool-leds.cfg]
[include LED/ToolheadLeds/T5-tool-leds.cfg]


[virtual_sdcard]
path: /home/demth/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

[force_move]
enable_force_move: True

[idle_timeout]
timeout: 1800

[respond]
default_type: echo

[rounded_path]
resolution: 0.2
replace_g0: False

[shaketune]
result_folder: ~/printer_data/config/ShakeTune_results
number_of_results_to_keep: 20
keep_raw_data: False
show_macros_in_webui: True
timeout: 600
measurements_chunk_size: 2
max_freq: 200
dpi: 300

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_0E0031000D51323532393433-if00
restart_method: command

[mcu cubic]
serial: /dev/serial/by-id/usb-Klipper_rp2040_5044340310359E1C-if00
  
[printer]
kinematics: corexy
max_velocity: 600  
max_accel: 15000             
max_z_velocity: 510  #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 4500      #1500
square_corner_velocity: 5.0

[temperature_sensor Rpi5]        
sensor_type: temperature_host

#####################################################################
#   X/Y Stepper Settings
#####################################################################
[autotune_tmc stepper_x]
motor: ldo-42sth48-2504ah
tuning_goal: performance
voltage: 48

[autotune_tmc stepper_x1]
motor: ldo-42sth48-2504ah
tuning_goal: performance
voltage: 48

[autotune_tmc stepper_y]
motor: ldo-42sth48-2504ah
tuning_goal: performance
voltage: 48

[autotune_tmc stepper_y1]
motor: ldo-42sth48-2504ah
tuning_goal: performance
voltage: 48

##  Connected to Motor_3-S3 Back Left Motor (B)
[stepper_x]
step_pin: PE2
dir_pin: !PE1
enable_pin: !PE0
rotation_distance: 40
microsteps: 16
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin: PC15 #tmc5160_stepper_x:virtual_endstop #PC15
position_min: 0
position_endstop: 350
position_max: 350
homing_speed: 75  #Max 100
second_homing_speed: 10
homing_retract_dist: 5
homing_positive_dir: true

##  Connected to Motor_2-S2 Front Right Motor
[stepper_x1]
step_pin: PE5
dir_pin: !PE4
enable_pin: !PE3
rotation_distance: 40
microsteps: 16
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper

##  Connected to Motor_4-S4 Back Right Motor (A)
[stepper_y]
step_pin: PB9
dir_pin: !PB8
enable_pin: !PB7
rotation_distance: 40
microsteps: 16
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin: PF0  #tmc5160_stepper_y:virtual_endstop #PF0
position_endstop: 325
position_min: -38
position_max: 325
homing_speed: 75  #Max 100
second_homing_speed: 10
homing_retract_dist: 9
homing_positive_dir: true

##  Connected to Motor_1-S1 Front Left Motor
[stepper_y1]
step_pin: PC14
dir_pin: !PC13
enable_pin: !PE6
rotation_distance: 40
microsteps: 16
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper

##  TMC2160 configuration
[tmc5160 stepper_x]
cs_pin: PD4
interpolate: false
spi_software_miso_pin: PC7
spi_software_mosi_pin: PC8
spi_software_sclk_pin: PC6
sense_resistor: 0.022
run_current: 1
stealthchop_threshold: 0
#diag1_pin: !PF1

##  TMC2160 configuration
[tmc5160 stepper_x1]
